import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Pages.css';

const SavedAddresses = () => {
  const [addresses, setAddresses] = useState([
    {
      id: 1,
      name: 'Home',
      address: '123 Main Street, Apt 4B',
      city: 'New York',
      state: 'NY',
      zip: '10001',
      isDefault: true
    },
    {
      id: 2,
      name: 'Office',
      address: '456 Business Ave, Suite 200',
      city: 'New York',
      state: 'NY',
      zip: '10002',
      isDefault: false
    }
  ]);

  const [showAddForm, setShowAddForm] = useState(false);
  const [showMapSelector, setShowMapSelector] = useState(false);
  const [newAddress, setNewAddress] = useState({
    name: '',
    address: '',
    city: '',
    state: '',
    zip: ''
  });

  const handleAddAddress = (e) => {
    e.preventDefault();
    const address = {
      ...newAddress,
      id: Date.now(),
      isDefault: addresses.length === 0
    };
    setAddresses([...addresses, address]);
    setNewAddress({ name: '', address: '', city: '', state: '', zip: '' });
    setShowAddForm(false);
  };

  const handleMapAddressSelect = (selectedAddress) => {
    setNewAddress({
      ...newAddress,
      address: selectedAddress.streetAddress,
      city: selectedAddress.city,
      state: selectedAddress.state,
      zip: selectedAddress.zip
    });
    setShowMapSelector(false);
    setShowAddForm(true);
  };

  const handleSetDefault = (id) => {
    setAddresses(addresses.map(addr => ({
      ...addr,
      isDefault: addr.id === id
    })));
  };

  const handleDeleteAddress = (id) => {
    setAddresses(addresses.filter(addr => addr.id !== id));
  };

  return (
    <div className="page-container">
      <div className="page-header">
        <Link to="/" className="back-button">
          ‚Üê Back to Home
        </Link>
        <h1>Saved Addresses</h1>
        <div className="add-address-buttons">
          <button 
            className="add-button map-button"
            onClick={() => setShowMapSelector(true)}
          >
            üó∫Ô∏è Select from Map
          </button>
          <button 
            className="add-button"
            onClick={() => setShowAddForm(true)}
          >
            + Manual Entry
          </button>
        </div>
      </div>

      <div className="page-content">
        {addresses.length > 0 ? (
          <div className="addresses-list">
            {addresses.map((address) => (
              <div key={address.id} className="address-card">
                <div className="address-header">
                  <h3>{address.name}</h3>
                  {address.isDefault && (
                    <span className="default-badge">Default</span>
                  )}
                </div>

                <div className="address-details">
                  <p>{address.address}</p>
                  <p>{address.city}, {address.state} {address.zip}</p>
                </div>

                <div className="address-actions">
                  {!address.isDefault && (
                    <button 
                      className="action-button"
                      onClick={() => handleSetDefault(address.id)}
                    >
                      Set as Default
                    </button>
                  )}
                  <button 
                    className="action-button secondary"
                    onClick={() => handleDeleteAddress(address.id)}
                  >
                    Delete
                  </button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="empty-state">
            <div className="empty-icon">üìç</div>
            <h3>No Saved Addresses</h3>
            <p>Add your delivery addresses for quick checkout</p>
            <div className="empty-state-buttons">
              <button 
                className="cta-button map-button"
                onClick={() => setShowMapSelector(true)}
              >
                üó∫Ô∏è Select from Map
              </button>
              <button 
                className="cta-button"
                onClick={() => setShowAddForm(true)}
              >
                + Manual Entry
              </button>
            </div>
          </div>
        )}

        {showAddForm && (
          <div className="modal-overlay">
            <div className="modal-content">
              <div className="modal-header">
                <h3>Add New Address</h3>
                <button 
                  className="close-button" 
                  onClick={() => setShowAddForm(false)}
                >
                  ‚úï
                </button>
              </div>

              <form onSubmit={handleAddAddress}>
                <div className="form-group">
                  <label>Address Name</label>
                  <input
                    type="text"
                    value={newAddress.name}
                    onChange={(e) => setNewAddress({...newAddress, name: e.target.value})}
                    placeholder="e.g., Home, Office"
                    required
                  />
                </div>

                <div className="form-group">
                  <label>Street Address</label>
                  <input
                    type="text"
                    value={newAddress.address}
                    onChange={(e) => setNewAddress({...newAddress, address: e.target.value})}
                    placeholder="Enter street address"
                    required
                  />
                </div>

                <div className="form-row">
                  <div className="form-group">
                    <label>City</label>
                    <input
                      type="text"
                      value={newAddress.city}
                      onChange={(e) => setNewAddress({...newAddress, city: e.target.value})}
                      placeholder="City"
                      required
                    />
                  </div>

                  <div className="form-group">
                    <label>State</label>
                    <input
                      type="text"
                      value={newAddress.state}
                      onChange={(e) => setNewAddress({...newAddress, state: e.target.value})}
                      placeholder="State"
                      required
                    />
                  </div>

                  <div className="form-group">
                    <label>ZIP Code</label>
                    <input
                      type="text"
                      value={newAddress.zip}
                      onChange={(e) => setNewAddress({...newAddress, zip: e.target.value})}
                      placeholder="ZIP"
                      required
                    />
                  </div>
                </div>

                <div className="modal-actions">
                  <button 
                    type="button" 
                    className="cancel-button" 
                    onClick={() => setShowAddForm(false)}
                  >
                    Cancel
                  </button>
                  <button type="submit" className="save-button">
                    Add Address
                  </button>
                </div>
              </form>
            </div>
          </div>
        )}

        {/* Map Address Selector */}
        {showMapSelector && (
          <MapAddressSelector
            onAddressSelect={handleMapAddressSelect}
            onClose={() => setShowMapSelector(false)}
          />
        )}
      </div>
    </div>
  );
};

export default SavedAddresses;
